import React, { useEffect } from "react";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import "../component-styles/Sidebar.scss";

const Sidebar = () => {
  return (
    <main>
      <ul className="sidebar">
        <a href="/" type="button" className="btn btn-default">
          Home
        </a>
        <li className="btn btn-default">
          <Link to="/planning/route">Route</Link>
        </li>
        <li className="btn btn-default">
          <Link to="/planning/equipment">Equipment</Link>
        </li>
        <li className="btn btn-default">
          <Link to="/planning/meals">Meals</Link>
        </li>
        <li className="btn btn-default">
          <Link to="/planning/emergency">Emergency Contact</Link>
        </li>
      </ul>
    </main>
  );
};

export default Sidebar;
